import React from 'react'
import web10 from '../src/images/w1.jpg'
const Header = () => {
    return (
        <div>
            <img src={web10} alt="logo" width='70' height='50' />
            <h1>CodinGyaan Keep</h1>
        </div>
    )
}

export default Header
